const Contact = ({contact, handleChange}) => {
    
    return (
        <div>
            <img src={contact.avatar}/>
            <div>| {contact.first_name}</div>
            <div>| {contact.last_name}</div>
            <input type="checkbox" onClick={(event) => handleChange(contact.id)}/>
        </div>
    )
}

export default Contact;
